// TestimonialsPage.js
import React, { useState } from "react";
import Footer from "../components/Footer";

const testimonials = [
  {
    id: 1,
    name: "Rahul Sharma",
    role: "Real Estate Agent",
    rating: 5,
    description:
      "Rahul helped me find my dream house very smoothly. Highly recommended!",
    profile: "https://randomuser.me/api/portraits/men/32.jpg",
  },
  {
    id: 2,
    name: "Anita Verma",
    role: "Real Estate Agent",
    rating: 4,
    description: "Good service, but communication could be improved.",
    profile: "https://randomuser.me/api/portraits/women/44.jpg",
  },
  {
    id: 3,
    name: "Vikram Singh",
    role: "Real Estate Agent",
    rating: 5,
    description:
      "Very professional and knowledgeable. Loved the experience!",
    profile: "https://randomuser.me/api/portraits/men/76.jpg",
  },
  {
    id: 4,
    name: "Priya Kapoor",
    role: "Real Estate Agent",
    rating: 3,
    description: "The service was okay, but could be faster in response.",
    profile: "https://randomuser.me/api/portraits/women/55.jpg",
  },
  {
    id: 5,
    name: "Amit Joshi",
    role: "Real Estate Agent",
    rating: 5,
    description:
      "Amazing experience! Extremely satisfied with the support provided.",
    profile: "https://randomuser.me/api/portraits/men/21.jpg",
  },
];

// ‚≠ê Stars Component
const Stars = ({ rating }) => {
  return (
    <div className="flex text-yellow-400 text-xl mb-1">
      {Array.from({ length: 5 }).map((_, i) => (
        <span key={i}>{i < rating ? "‚òÖ" : "‚òÜ"}</span>
      ))}
    </div>
  );
};

// üé¥ Testimonial Card
const TestimonialCard = ({ testimonial }) => {
  const { name, role, rating, description, profile } = testimonial;

  return (
    <div className="bg-[#0D1B2A] text-white rounded-xl p-6 flex items-start gap-6 shadow-xl border border-blue-900/30 transition-all duration-300">
      <div className="w-28 h-28 rounded-full overflow-hidden border-4 border-blue-600 shadow-lg">
        <img src={profile} alt={name} className="object-cover w-full h-full" />
      </div>

      <div className="flex-1">
        <Stars rating={rating} />
        <h2 className="text-2xl font-bold">{name}</h2>
        <p className="text-blue-300 mb-2">{role}</p>

        <p className="text-gray-300 text-lg leading-relaxed">
          <span className="text-blue-400 text-3xl">‚ùù </span>
          {description}
        </p>
      </div>
    </div>
  );
};

export default function TestimonialsPage() {
  const [index, setIndex] = useState(0);

  // Next & Prev logic
  const nextTestimonial = () => {
    setIndex((prev) => (prev + 1) % testimonials.length);
  };

  const prevTestimonial = () => {
    setIndex((prev) => (prev - 1 + testimonials.length) % testimonials.length);
  };

  return (
    <div className="min-h-screen bg-[#0A1128] py-10">
      {/* Header Section */}
      <div
        className="w-full h-64 flex items-center justify-center bg-cover bg-center mb-10"
        style={{
          backgroundImage:
            "url('https://images.unsplash.com/photo-1503264116251-35a269479413?auto=format&fit=crop&w=1600&q=80')",
        }}
      >
        <h1 className="text-white text-4xl font-bold bg-black/50 px-6 py-3 rounded-xl shadow-lg backdrop-blur-sm">
          Testimonial Details
        </h1>
      </div>

      {/* Centered Single Testimonial Slider */}
      <div className="max-w-4xl mx-auto px-4 mb-20">
        <TestimonialCard testimonial={testimonials[index]} />

        {/* Next / Prev Buttons */}
        <div className="flex justify-center gap-6 mt-6">
          <button
            onClick={prevTestimonial}
            className="bg-blue-700 hover:bg-blue-800 text-white px-6 py-2 rounded-lg shadow-md transition"
          >
            ‚óÄ Prev
          </button>

          <button
            onClick={nextTestimonial}
            className="bg-blue-700 hover:bg-blue-800 text-white px-6 py-2 rounded-lg shadow-md transition"
          >
            Next ‚ñ∂
          </button>
        </div>
      </div>

      {/* Footer with extra gap already added above */}
      <Footer />
    </div>
  );
}
